import test from 'ava';
import canCompleteCircuit from './index.js';

test('Test Case 1', t => {
    let answer = canCompleteCircuit(
        [1,2,3,4,5],
        [3,4,5,1,2]
    );

    t.is(answer, 3);
});

test('Test Case 2', t => {
    let answer = canCompleteCircuit(
        [2,3,4],
        [3,4,3]
    );

    t.is(answer, -1);
});

test('Test Case 3', t => {
    let answer = canCompleteCircuit(
        [5,8,2,8],
        [6,5,6,6]
    );

    t.is(answer, 3);
});

test('Test Case 4', t => {
    let answer = canCompleteCircuit(
        [2],
        [2]
    );

    t.is(answer, 0);
});

